import React, { useState } from "react"
import Input from "../components/Input"

const Form = ({ type }) => {
  const [user, setUser] = useState()

  return (
    <form>
      <Input label="email" name="email"></Input>
      <Input label="password" name="password"></Input>
      <button></button>
    </form>
  )
}

export default Form
